DROP TABLE IF EXISTS states;
CREATE TABLE states (
  id uuid NOT NULL,
  code varchar(255) DEFAULT NULL,
  name varchar(255) NOT NULL,
  created_at timestamp NULL DEFAULT NULL,
  updated_at timestamp NULL DEFAULT NULL,
  deleted_at timestamp NULL DEFAULT NULL,
  PRIMARY KEY (id)
);


DROP TABLE IF EXISTS towns;
CREATE TABLE towns (
  id uuid NOT NULL,
  code varchar(255) DEFAULT NULL,
  name varchar(255) NOT NULL,
  state_id uuid NOT NULL,
  created_at timestamp NULL DEFAULT NULL,
  updated_at timestamp NULL DEFAULT NULL,
  deleted_at timestamp NULL DEFAULT NULL,
  PRIMARY KEY (id),
  CONSTRAINT towns_state_id_foreign FOREIGN KEY (state_id) REFERENCES states(id)
);



DROP TABLE IF EXISTS districts;
CREATE TABLE districts (
  id uuid NOT NULL,
  code varchar(255) DEFAULT NULL,
  name varchar(255) NOT NULL,
  town_id uuid NOT NULL,
  created_at timestamp NULL DEFAULT NULL,
  updated_at timestamp NULL DEFAULT NULL,
  deleted_at timestamp NULL DEFAULT NULL,
  PRIMARY KEY (id),
  CONSTRAINT districts_town_id_foreign FOREIGN KEY (town_id) REFERENCES towns(id)
);



DROP TABLE IF EXISTS villages;
CREATE TABLE villages (
  id uuid NOT NULL,
  code varchar(255) DEFAULT NULL,
  name varchar(255) NOT NULL,
  district_id uuid NOT NULL,
  created_at timestamp NULL DEFAULT NULL,
  updated_at timestamp NULL DEFAULT NULL,
  deleted_at timestamp NULL DEFAULT NULL,
  PRIMARY KEY (id),
  CONSTRAINT villages_district_id_foreign FOREIGN KEY (district_id) REFERENCES districts(id)
);


